import React from "react";
import Navbar from "../../components/LandingPageComponents/Navbar";
import mid from "../../assets/mid.png";
import img3 from "../../assets/img3.png";
import "../../components/LandingPageComponents/button.css"
import "../LandingPage/LP.css";
import { NavLink } from "react-router-dom";
import abeg from "../../assets/abeg.png";
import access_bank from "../../assets/abeg.png";
import airtel from "../../assets/abeg.png";
import bolt from "../../assets/abeg.png";
import first_bank from "../../assets/abeg.png";

const HomePage = () => {
    return (
      <div className="mainContainer" style={{backgroundColor: "#FFFFFF"}}>

        {/** Navbar */}
        <div>
            <Navbar />
        </div>

         {/** First background image */}
        <div className="main-div">
            <div className="item">

                <p className="paragraph">
                    You can learn<br />
                    anything,<br />
                    anywhere.<br />
                </p>
                <p className="paragraph2">
                    Education is the process of facilitating learning, or the acquisition of<br />
                    knowledge, skills, values, beliefs and habits.
                </p>
                <button className="botn2">Get started</button>
            </div>
        </div>

         {/** second background image */}
        <div className="middle">
            <div style={{height: "16px"}}>
                <img src={mid} alt="" />
            </div>
        </div>

             {/** last image */}
            <div className="img3">
                <img src={img3} alt="" />
            </div>

            {/** second to the last div */}
            <div className="h1">
                <h1 className="header">Our Partners</h1>
            </div>

             {/** last div */}
            <div className="scard">
                <h1 className="scard2">Scorecard</h1>
                <div>
                    <div className="paragraph3">
                        <NavLink className="list" to={""}>Home</NavLink>
                        <NavLink className="list" to={""}>About</NavLink>
                        <NavLink className="list" to={""}>Learnings</NavLink>
                        <NavLink className="list" to={""}>Contact</NavLink>
                    </div>
                <hr />
                <ol className="oll">
                    <li><a href="">Home</a></li>
                    <li><a href="">About</a></li>
                    <li><a href="">Learnings</a></li>
                    <li><a href="">Contact</a></li>
                </ol>
            </div>

        </div>
      </div>
    )
}

export default HomePage;
